  margin: 0;
  padding: 0;
  -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
}

body {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  overflow: hidden;
  -webkit-touch-callout: none;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
}

#container {
  width: 100vw;
  height: 177.7vw;
  position: absolute;
  overflow: hidden;
  display: flex;
  justify-content: center;
  align-items: center;
}

.hide {
  display: none;
}

.blur {
  filter: blur(10px);
  -webkit-animation: blurAnimation 1s;
          animation: blurAnimation 1s;
}

.transtion {
  transition: ease-in-out;
}

@-webkit-keyframes blurAnimation {
  from {
    filter: blur(0px);
  }
  to {
    filter: blur(10px);
  }
}

@keyframes blurAnimation {
  from {
    filter: blur(0px);
  }
  to {
    filter: blur(10px);
  }
}

.appears-animation {
  -webkit-animation: appearsAnimation 1.5s forwards;
          animation: appearsAnimation 1.5s forwards;
}

.disappear-animation {
  -webkit-animation: disappearAnimation 1.5s forwards;
          animation: disappearAnimation 1.5s forwards;
}

#cover {
  width: 100vw;
  height: 177.7vw;
  position: absolute;
  z-index: 100;
  background-color: red;
  -webkit-animation: coverAnimation 1s forwards;
          animation: coverAnimation 1s forwards;
}

@-webkit-keyframes coverAnimation {
  0% {
    opacity: 0;
  }
  25% {
    opacity: 0.7;
  }
  50% {
    opacity: 0;
  }
  75% {
    opacity: 0.7;
  }
  100% {
    opacity: 0;
  }
}

@keyframes coverAnimation {
  0% {
    opacity: 0;
  }
  25% {
    opacity: 0.7;
  }
  50% {
    opacity: 0;
  }
  75% {
    opacity: 0.7;
  }
  100% {
    opacity: 0;
  }
}

@-webkit-keyframes appearsAnimation {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

@keyframes appearsAnimation {
  from {
    opacity: 0;
  }
  to {
    opacity: 1;
  }
}

@-webkit-keyframes disappearAnimation {
  from {
    opacity: 1;
  }
  to {
    opacity: 0;
  }
}

@keyframes disappearAnimation {
  from {
    opacity: 1;
  }
  to {
    opacity: 0;
  }
}
